import React,{useState} from 'react';
const bgColorbg = "orange";
const App = () => {
  const [bgColor,newColor] = useState(bgColorbg);
  const cColor=()=>{
    newColor("green");
  }
  return(
    <>
    <div>
      <h1 className={BackgroundColor="bgColorbg"}>please work pal</h1>
      <button className="btn btn-dark" onClick={cColor}>click me</button>
    </div>

    </>
  )
    
};

export default App;
